import React from "react";
import "./App.css";
import Home from "./components/Home/Home";
import Academics from "./components/Academics/Academics";
import Ask from "./components/Ask/Ask";
import Programming from "./components/Programming/Programming";
import Qna from "./components/Qna/Qna";

function App() {
  return (
    <div className="App">
      <Router>
        <div className="container">
          <br />
          <PrivateRoute exact path="/" exact component={Home} />
          <PrivateRoute exact path="/edit/:id" component={Academics} />
          <PrivateRoute exact path="/create" component={Ask} />
          <Route exact path="/register" component={Programming} />
          <Route exact path="/login" component={Qna} />
        </div>
      </Router>
    </div>
  );
}

export default App;
